import React from "react";
import "./Post.css";

const Post = () => {
  const post = posts[2];
  return (
    <div className="post">
      <img src={post.img} alt="" className="postImg" />
      <h1 className="postTitle">{post.title}</h1>
      <p className="postDEsc">{post.desc}</p>
      <p className="postLongDesc">{post.longDesc} </p>
    </div>
  );
};

export default Post;
